/* VCD dumping functions */
MOD_mkAXIConverter_tb & mkAXIConverter_tb_backing(tSimStateHdl simHdl)
{
  static MOD_mkAXIConverter_tb *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkAXIConverter_tb(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkAXIConverter_tb::dump_VCD_defs()
{
  (mkAXIConverter_tb_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkAXIConverter_tb::dump_VCD(tVCDDumpType dt)
{
  (mkAXIConverter_tb_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkAXIConverter_tb_backing(sim_hdl));
}
